CREATE TABLE IF NOT EXISTS `cities` (
  `id` int(10) NOT NULL DEFAULT '0',
  `coordinates` point NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `name_alt` varchar(255) DEFAULT NULL,
  `name_ascii` varchar(255) DEFAULT NULL,
  `is_capital` tinyint(1) DEFAULT NULL,
  `is_world_city` tinyint(1) DEFAULT NULL,
  `is_mega_city` tinyint(1) DEFAULT NULL,
  `country` varchar(255) DEFAULT NULL,
  `country_iso_alpha3` varchar(3) DEFAULT NULL,
  `region` varchar(255) DEFAULT NULL,
  `time_zone` varchar(255) DEFAULT NULL,
  PRIMARY KEY (id),
  SPATIAL KEY coordinates (coordinates)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

